import React from "react";

const Navbar = () => {
    return (
      <div>
        <nav className="nav">
          <Link to="/">Home</Link>
          <span></span>
          <Link to="/login">Logout</Link>
        </nav>
      </div>
    );
  };
  

export default Homepage;
